import React, { useState, useEffect } from "react";
import axios from 'axios'
import Button from '@mui/material/Button';
import SendIcon from '@mui/icons-material/Send';
import DisabledByDefaultRoundedIcon from '@mui/icons-material/DisabledByDefaultRounded';
import Form from 'react-bootstrap/Form';
import './omsStyle/PlaceOrder.css';
import { Link } from "@mui/material";


const PlaceOrder = () => {
  const initialValue = { mobileNo: "", productName: "", couponCode: "" }
  const [order, setOrder] = useState(initialValue);
  const [errors, setErrors] = useState({});
  const [isSubmit, setIsSubmit] = useState(false);

  const { mobileNo, productName, couponCode } = order;
  const onInputChange = e => {
    setOrder({ ...order, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setErrors(validate(order));
    setIsSubmit(true);
    //MySweetAlter();
    await axios.post("http://localhost:8080/placeorder", order)
  };
  useEffect(() => {
    console.log(errors);
    if (Object.keys(errors).length === 0 && isSubmit) {
      console.log(errors);
    }
  }, [errors])

  const validate = (values) => {
    const errors = {};

    if (values.mobileNo.length === 0) {
      errors.mobileNo = "mobileNo is required!";
    }
    if (values.productName.length === 0) {
      errors.productName = "productName is required!";
    }
    return errors;
  }
  return (
    <div className="">
      <div className="container">
        <Form onSubmit={e => handleSubmit(e)}>
          <div className='orderheading'><h2>Read order</h2></div>
          {/* {Object.keys(errors).length === 0 && isSubmit ? <p>successful</p>: <p>unsuccessful</p>}  */}
          <div className='inputStyle'>
            <Form.Group className="mb-3">
              <Form.Label>Mobile-No</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter Your Mobile No"
                name="mobileNo"
                value={mobileNo}
                onChange={e => onInputChange(e)} />
            </Form.Group>

        <p style={{ color: "red" }}>{errors.mobileNo}</p>


            <Form.Group className="mb-3">
              <Form.Label>productName</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter Your Product Name"
                name="productName"
                value={productName}
                onChange={e => onInputChange(e)} />
            </Form.Group>

        <p style={{ color: "red" }}>{errors.productName}</p>
            <Form.Group className="mb-3" >
              <Form.Label>Password</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter Your Coupon Code"
                name="couponCode"
                value={couponCode}
                onChange={e => onInputChange(e)} />
            </Form.Group>
          </div>
          <div className='buttondiv'>
            <Button className='buttonplace' variant="contained" sx={{ marginRight: '80px' }} endIcon={<SendIcon />}>Place</Button>
       
            <Link to = "/">
          <button className="btn btn-primary">cancle</button></Link>
          </div>
        </Form>
        {Object.keys(errors).length === 0 && isSubmit ? <p style={{ color: "green" }}>successful</p> : <p>unsuccessful</p>}

      </div>
    </div>
  );
}

export default PlaceOrder;
